import React from 'react';
import {View, SafeAreaView, StyleSheet} from 'react-native';
import {
  Avatar,
  Title,
  Caption,
  Text,
  TouchableRipple,
} from 'react-native-paper';

import Icon from 'react-native-vector-icons/MaterialCommunityIcons';


import files from '../assets/filesBase64';


const ProfileScreen = ({navigation}) => {

  const myCustomShare = async() => {
    const shareOptions = {
      message: '.',
      url: files.appLogo,
      // urls: [files.image1, files.image2]
    }

    try {
      const ShareResponse = await Share.open(shareOptions);
      console.log(JSON.stringify(ShareResponse));
    } catch(error) {
      console.log('Error => ', error);
    }
  };

  return (
    <SafeAreaView style={styles.container}>

      <View style={styles.userInfoSection}>
        <View style={{flexDirection: 'row', marginTop: 20}}>
          <Avatar.Image 
            source={{
              uri: 'https://api.adorable.io/avatars/80/abott@adorable.png',
            }}
            size={80}
          />
          <View style={{marginLeft: 20}}>
            <Title style={[styles.title, {
              marginTop:25,
              marginBottom: 5,
            }]}>User</Title>
            <Caption style={styles.caption}></Caption>
          </View>
        </View>
      </View>

      <View style={styles.userInfoSection}>
        <View style={styles.row}>
          <Icon  color="#000" size={20}/>
          <Text style={{color:"#777777", marginLeft: 22}}></Text>
        </View>
        <View style={styles.row}>
          <Icon name="phone-outline" color="#000" size={20}/>
          <Text style={{color:"#777777", marginLeft: 20,fontSize: 18,}}>+92-300000008</Text>
        </View>
        <View style={styles.row}>
          <Icon  color="#5B79E0" size={20}/>
          <Text style={{color:"#777777", marginLeft: 20,fontSize: 18,}}></Text>
        </View>
        <View style={styles.row}>
          <Icon name="email-outline" color="#000" size={22}/>
          <Text style={{color:"#777777", marginLeft: 20,fontSize: 18,}}>user@email.com</Text>
        </View>
      </View>

      <View style={styles.infoBoxWrapper}>
          
      <View style={styles.menuWrapper}>
        <TouchableRipple     onPress={() => navigation.navigate('Settings')} >
          <View style={styles.menuItem}>
            <Icon name="heart-outline" color="#000" size={25}/>
            <Text style={styles.menuItemText}>Requests</Text>
          </View>
        </TouchableRipple>
        
        
        
        
      </View>
      </View>



      
    </SafeAreaView>
  );
};

export default ProfileScreen;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor:'#e6e6e6'
  },
  userInfoSection: {
    paddingHorizontal: 30,
    marginBottom: 15,
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
  },
  caption: {
    fontSize: 14,
    lineHeight: 14,
    fontWeight: '500',
  },
  row: {
    flexDirection: 'row',
    marginBottom: 3,
  },
  infoBoxWrapper: {
    borderBottomColor: '#dddddd',
    borderBottomWidth: 1,
    borderTopColor: '#dddddd',
    borderTopWidth: 1,
    height: 100,
  },
  infoBox: {
    width: '50%',
    alignItems: 'center',
    justifyContent: 'center',
  },
  menuWrapper: {
    marginTop: 20,
  },
  menuItem: {
    flexDirection: 'row',
    paddingVertical: 15,
    paddingHorizontal: 30,
  },
  menuItemText: {
    color: '#777777',
    marginLeft: 20,
    fontWeight: '600',
    fontSize: 16,
    lineHeight: 26,
  },
})
